import React from "react";
import { Modal, Button } from "react-bootstrap";
import colors from "../../config/colors";

function DoneComponent(props) {
  return (
    <>
      <Modal
        {...props}
        size="200px"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <img
          src={props.data.img}
          attr="status"
          style={{ textAlign: "center", width: "100px", height: "100px" }}
        />
        <h4 style={{ color: colors.secondary1, textAlign: "center" }}>
          {props.data.isSuccess ? "SuccessFull" : "Failed"} Transaction
        </h4>
      </Modal>
    </>
  );
}

export default DoneComponent;
